CREATE TABLE evaluacionproyectoplanilla (
  cd_evaluacionproyectoplanilla int(11) NOT NULL auto_increment,
  ds_evaluacionproyectoplanilla varchar(255) default NULL,
  cd_subgrupo int(11) default NULL,
  ds_letra varchar(1) default NULL,
  PRIMARY KEY  (cd_evaluacionproyectoplanilla),
  KEY cd_evaluacionproyectoplanilla (cd_subgrupo)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;


CREATE TABLE evaluacionproyectosubgrupo (
  cd_subgrupo int(11) NOT NULL auto_increment,
  ds_subgrupo varchar(255) default NULL,
  ds_pdf varchar(255) default NULL,
  PRIMARY KEY  (cd_subgrupo)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;


CREATE TABLE evaluacionproyectopuntaje (
  cd_evaluacionproyectopuntaje int(11) NOT NULL auto_increment,
  cd_evaluacion int(11) default NULL,
  cd_evaluacionproyectoplanilla int(11) default NULL,
  nu_puntaje float default NULL,
  PRIMARY KEY  (cd_evaluacionproyectopuntaje),
  KEY cd_evaluacion (cd_evaluacion,cd_evaluacionproyectoplanilla)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE evaluacionproyecto (
  cd_evaluacion int(10) NOT NULL auto_increment,
  cd_usuario int(10) default NULL,
  cd_proyecto int(10) default NULL,
  cd_estado int(11) default NULL,
  dt_fecha varchar(14) default NULL,
  nu_puntaje float NOT NULL,
  bl_interno binary(1) NOT NULL,
  ds_observacion text NOT NULL,
  PRIMARY KEY  (cd_evaluacion),
  UNIQUE KEY cd_usuario (cd_usuario,cd_proyecto),
  KEY cd_estado (cd_estado)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;


CREATE TABLE evaluadorespecialidad (
  cd_evaluadorespecialidad int(11) NOT NULL auto_increment,
  cd_usuario int(11) default NULL,
  cd_especialidad int(11) default NULL,
  PRIMARY KEY  (cd_evaluadorespecialidad),
  KEY cd_evaluacion (cd_usuario,cd_especialidad)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;


ALTER TABLE evaluacionproyecto ADD ds_observacionsecyt TEXT NULL ;

ALTER TABLE proyecto ADD bl_notificacion BINARY NOT NULL DEFAULT '0';

